import React, { Component, Fragment } from "react";

export default class Movies extends Component {

    state = {movies: []}

    render() {
        return(
            <Fragment>
                <h2>Choose a movie</h2>
                <ul>
                    {this.state.movies.map((m) =>(
                        <li key={m.id}>
                            {m.title}
                        </li>
                    ))}
                </ul>


            </Fragment>
        );
    }
}
